function stripQuotes(str: string | undefined) {
    if (!str) return;
    return str.replace(/"/g, '');
}

export function getContinentFromISO(iso: string): string | undefined {
    return stripQuotes(GEOLOCATION_DATA[iso]?.name);
}

export function getCountryFromISO(iso: string, continent_iso?: string): string | undefined {
    if (continent_iso) {
        return stripQuotes(GEOLOCATION_DATA[continent_iso]?.countries[iso]?.name);
    } else {
        const continent_isos = Object.keys(GEOLOCATION_DATA);
        for (const continent_iso of continent_isos) {
            const target = GEOLOCATION_DATA[continent_iso].countries[iso]?.name;
            if (target) return stripQuotes(target);
        }
    }
}

export function getRegionFromISO(iso: string, country_iso: string, continent_iso?: string): string | undefined {
    if (continent_iso) {
        return stripQuotes(GEOLOCATION_DATA[continent_iso]?.countries[country_iso]?.regions[iso]?.name);
    } else {
        const continent_isos = Object.keys(GEOLOCATION_DATA);
        for (const continent_iso of continent_isos) {
            const target = GEOLOCATION_DATA[continent_iso].countries[country_iso]?.regions[iso]?.name;
            if (target) return stripQuotes(target);
        }
    }
}

export function getCityFromISO(iso: string, region_iso: string, country_iso: string, continent_iso?: string): string | undefined {
    if (continent_iso) {
        return stripQuotes(GEOLOCATION_DATA[continent_iso]?.countries[country_iso]?.regions[region_iso]?.cities[iso]?.name);
    } else {
        const continent_isos = Object.keys(GEOLOCATION_DATA);
        for (const continent_iso of continent_isos) {
            const target = GEOLOCATION_DATA[continent_iso].countries[country_iso]?.regions[region_iso]?.cities[iso]?.name;
            if (target) return stripQuotes(target);
            
        }
    }
}